import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function PlayerRegister() {
  const navigate = useNavigate();
  const [fields, setFields] = useState({
    full_name_eng: "",
    full_name_nep: "",
    dob_ad: "",
    dob_bs: "",
    gender: "",
    father_name: "",
    mother_name: "",
    parent_contact: "",
    parent_email: "",
    address: "",
  });
  const [photo, setPhoto] = useState(null);
  const [certificate, setCertificate] = useState(null);
  const [extracting, setExtracting] = useState(false);
  const [submitting, setSubmitting] = useState(false);
  const [error, setError] = useState("");
  const token = localStorage.getItem("token");

  // OCR extraction
  const handleOCR = async () => {
    if (!certificate) return setError("Upload birth certificate image first");
    setExtracting(true);
    setError("");
    try {
      const formData = new FormData();
      formData.append("certificate", certificate);
      const res = await axios.post(
        "http://localhost:5000/api/players/ocr",
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "multipart/form-data",
          },
        }
      );
      setFields((prev) => ({
        ...prev,
        ...res.data.data, // expect {full_name_eng, dob_ad, ...}
      }));
    } catch (e) {
      setError("OCR failed: " + (e.response?.data?.message || e.message));
    }
    setExtracting(false);
  };

  // Submit registration
  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setSubmitting(true);
    try {
      const formData = new FormData();

      // Map frontend fields to backend expected fields
      formData.append("full_name", fields.full_name_eng);
      formData.append("dob", fields.dob_ad);
      formData.append("gender", fields.gender);
      formData.append("parent_name", fields.father_name);
      if (fields.parent_contact) formData.append("parent_contact", fields.parent_contact);
      if (fields.parent_email) formData.append("parent_email", fields.parent_email);

      if (photo) formData.append("photo", photo);
      if (certificate) formData.append("birthCertificate", certificate);

      await axios.post(
        "http://localhost:5000/api/players/register",
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "multipart/form-data",
          },
        }
      );
      alert("Player registered!");
      navigate("/dashboard");
    } catch (e) {
      setError("Registration failed: " + (e.response?.data?.message || e.message));
    }
    setSubmitting(false);
  };

  return (
    <form
      onSubmit={handleSubmit}
      className="max-w-xl mx-auto my-10 p-6 bg-white rounded-2xl shadow"
      encType="multipart/form-data"
    >
      <h2 className="text-2xl font-bold mb-6 text-blue-700">Register Player</h2>

      {[
        { label: "Full Name (English)", key: "full_name_eng", required: true },
        { label: "Full Name (Nepali)", key: "full_name_nep" },
        { label: "DOB (AD)", key: "dob_ad", type: "date", required: true },
        { label: "DOB (BS)", key: "dob_bs" },
        { label: "Gender", key: "gender", required: true },
        { label: "Father's Name", key: "father_name" },
        { label: "Mother's Name", key: "mother_name" },
        { label: "Parent Contact", key: "parent_contact" },
        { label: "Parent Email", key: "parent_email" },
        { label: "Address", key: "address" },
      ].map((f) => (
        <div className="mb-3" key={f.key}>
          <input
            type={f.type || "text"}
            placeholder={f.label}
            value={fields[f.key] || ""}
            required={!!f.required}
            onChange={(e) =>
              setFields((prev) => ({ ...prev, [f.key]: e.target.value }))
            }
            className="w-full p-2 rounded border border-gray-200"
          />
        </div>
      ))}

      <div className="mb-3">
        <label className="block mb-1">Photo:</label>
        <input
          type="file"
          accept="image/*"
          onChange={(e) => setPhoto(e.target.files[0])}
        />
      </div>
      <div className="mb-3">
        <label className="block mb-1">Birth Certificate:</label>
        <input
          type="file"
          accept="image/*"
          onChange={(e) => setCertificate(e.target.files[0])}
        />
        <button
          type="button"
          onClick={handleOCR}
          disabled={extracting || !certificate}
          className="ml-2 px-3 py-1 bg-blue-500 text-white rounded"
        >
          {extracting ? "Extracting..." : "Extract from OCR"}
        </button>
      </div>

      <button
        type="submit"
        className="mt-4 w-full px-4 py-2 bg-green-600 text-white rounded"
        disabled={submitting}
      >
        {submitting ? "Registering..." : "Register Player"}
      </button>

      {error && <div className="text-red-600 mt-2">{error}</div>}
    </form>
  );
}
